import {
    Container,
    CssBaseline,
    useMediaQuery,
  } from "@material-ui/core";

import Leftbar from '../inc/Leftbar';
import Feeds from '../inc/Feeds';
import Rightbar from '../inc/Rightbar';
// import Slider from '../inc/Slider';


function Home() {
    return (
        <Container className={classes.container}>
        <div className="row">
        <Leftbar />
        <Feeds />
        <Rightbar />
        </div>
        </Container>
    )
}

export default Home
